script: |
  super -f text -I q9650.spq | sort > q9650.out

inputs:
  - name: q9650.spq
    data: |
      SELECT DISTINCT - cor0.col2 + ( 74 ) / - col2 + - ( col2 ) / + col1 AS col2 FROM tab1 (FORMAT parquet) cor0;
  - name: tab1

outputs:
  - name: q9650.out
    data: |
      -103
      -57
      -63
